import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { tests, checkStatus } from './Test'; // Используйте фигурные скобки для импорта именованных экспортов

const Section = styled.section`
    display: flex;
    justify-content: center;
    align-items: flex-start;
    flex-direction: column;
    padding-left: 8%;
    gap: 35px;
    padding-top: 2%;
`

const Attempt = styled.div`
    width: 294px;
    height: 64px;
    background-color: #D9D9D9;
    color: #000000;
    font-size: 16px;
    font-weight: 400;
    font-family: 'Montserrat';
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const Block = styled.div`
    width: 1294px;
    height: ${({ $height }) => $height ? '585px' : '196px'};
    background-color: #D5DEF6;
    border-radius: 10px;
    display: grid;
    grid-template-columns: repeat(3, 1fr); /* Только три карточки на одной линии */
    gap: 10px;
`

const Li = styled.li`
    width: 320px; /* Ширина карточки */
    height: 102px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #ffffff;
`

const Attempts = () => {
    return (
        <>
            <Section>
                <Attempt>
                    Попытки 2
                </Attempt>
                <Block $height>
                    {tests.map((test, index) => (
                        <Li key={index}>
                            <div>
                                <p>Номер теста: {test.number}</p>
                                <p>Время выполнения: {test.time} секунд</p>
                                <p>Статус: {checkStatus(test.status)}</p>
                            </div>
                        </Li>
                    ))}
                </Block>
                <Block></Block>
                <div>
                    <div>
                        <Link></Link>
                        <Link></Link>
                    </div>
                </div>
            </Section>
        </>
    );
}

export default Attempts;
